# Convert the raw data to a pandas DataFrame
data = []
for line in raw_data.strip().split('\n')[1:]:
    parts = line.split(',')
    n = int(parts[0])
    s = int(parts[1])
    exec_times = list(map(float, parts[2:]))
    avg_exec_time = sum(exec_times) / len(exec_times)
    data.append([n, s, avg_exec_time])

df = pd.DataFrame(data, columns=['N', 's', 'Average Execution Time'])

# Visualization

